import React from "react";
import { Paper, Grid, TextField } from "@material-ui/core";

function Question() {
  return (
    <Paper
      style={{
        backgroundRepeat: "no-repeat",
        backgroundImage: `url("/assets/bg-2.jpg")`,
        paddingTop: "5em",
        paddingBottom: "1em",
        boxShadow: "none",
      }}
    >
      <h3 className="text-white text-center">Got a Question?</h3>
      <Grid container spacing={2}>
        <Grid item md={3}></Grid>
        <Grid container md={6} spacing={2}>
          <Grid item md={6}>
            <TextField
              className="bg-white"
              variant="outlined"
              size="small"
              label="Name"
              fullWidth
            />
          </Grid>
          <Grid item md={6}>
            <TextField variant="outlined" size="small" label="Name" fullWidth />
          </Grid>
        </Grid>
        <Grid item md={3}></Grid>
      </Grid>
    </Paper>
  );
}

export default Question;
